Special Forces (2011)

In Afghanistan a renowned journalist, Elsa Casanova (Diane Kruger), is ambushed and kidnapped by Ahmed Zaef (Raz Degan). Zaef immediately announces his intent to put Elsa to death. A French Special Forces team led by Kovax (Djimon Hounsou) is dispatched to rescue her in the Pakistani tribal areas after being initially sent to Kosovo to capture a war criminal. After their extraction fails, the group begins the long trek through the mountains towards the Afghan border, pursued by Zaef and his forces.

